import React, { Component } from "react";

class Tab extends Component {
  render() {
    const items = this.props.items;
    return (
      <React.Fragment>
        <ul>
          {items.map((item) => (
            <li key={item.id} className="">{item.name}</li>
          ))}
        </ul>
        <div>
          {items.map((item) => (
            <section key={item.id}>test</section>
          ))}
        </div>
      </React.Fragment>
    );
  }
}

export default Tab;
